import React from "react";

function TwoInner() {
  return (
    <div className="th-two-inner">
      <h2 className="th-header-one-inner">Leave Reviews</h2> <br />
      <p className="th-text-one-inner">
        What did others say about your product? This gives shoppers the ability
        to see how respected and usefull your products are for their own needs.
      </p>
    </div>
  );
}

export default TwoInner;
